import React, { useEffect, useState } from 'react'
import Layouts from '../../Layouts/Layouts'
import { useLoginManager } from '../../StateManagement/UserManagement';
import { useNavigate } from 'react-router-dom';
import img from './../../assests/images/Icons/maths.png';
import axios from 'axios';
function ProjectToGuide() {
    const{userID} = useLoginManager();
    const navigate = useNavigate();
    const [datas,setData] = useState();

    useEffect(()=>{
      const getData = async()=>{
        try{
            const response  = await axios.get(`http://localhost:3001/t/guideProjects/${userID}`);
            setData(response.data);
        }
        catch(error)
        {  
            console.log(error);
        }
      }
      getData();
    },[])
    console.log(datas);
  return (
    <Layouts>
        <div className='flex felx-col md:flex-row lg:flex-row justify-center items-center'>
        {datas?.map((data,index)=>(
            <div key={index}>
            <div className='flex flex-col gap-4 justify-center items-center'>
                <img src={img}  wid className='bg-bgBlueDark rounded-full'/>
                <p>{data.ProjectID}</p>
            </div>
            </div>
        ))}
        </div>
    </Layouts>
  )
}

export default ProjectToGuide
